// 0

export const sanitizeText = (input) => {
  // Use regex to match only lowercase alphabets and numbers
  return !!input ? input.toLowerCase().replace(/[^a-z0-9]/g, '') : input;
}

export const getColors = () => {
  const cssVariables = getComputedStyle(document.documentElement);
  return {
    white: cssVariables.getPropertyValue('--background-color').trim(),
    seashell: cssVariables.getPropertyValue('--border-color').trim(),
    prussianBlue: cssVariables.getPropertyValue('--theme-color').trim(),
    eerieBlack: cssVariables.getPropertyValue('--text1-color').trim(),
    outerSpace: cssVariables.getPropertyValue('--text2-color').trim(),
    aliceBlue: cssVariables.getPropertyValue('--alice-blue').trim(),
    sandyBrown: cssVariables.getPropertyValue('--sandy-brown').trim(),
    ruddyBrown: cssVariables.getPropertyValue('--ruddy-brown').trim(),
    gray: cssVariables.getPropertyValue('--gray').trim(),
    lightGray: cssVariables.getPropertyValue('--light-gray').trim(),
  };
};

export const filterString = (input) => {
     // Convert the input string to lowercase
  const lowercased = input.toLowerCase();
    // Regular expression to match only numbers and lowercase letters
    return lowercased.replace(/[^a-z0-9]/g, '');
  };

// 1

export const getBaseUrlFromSession = () => {
    const sessionData = JSON.parse(localStorage.getItem('tdprb-baseURL'));
    return sessionData.baseUrl;
}

// 2

export const toSentenceCase = (value = 'test') => {
    if (typeof value !== 'string') {
        return ''; // or handle as appropriate, e.g., return the input, a default value, or an empty string
    }

    return value
        .split(' ')
        .map(word => word.charAt(0).toUpperCase() + word.slice(1).toLowerCase())
        .join(' ');
};

// 4

export  const  getStepSliderTicks = (i, n) => {
    return (100 / n) * i;
}

// 5

export const setSessionData = (name,value) => {
    sessionStorage.setItem(name, JSON.stringify(value));
}

export const getSessionData = (name) => {
    return sessionStorage.getItem(name) && JSON.parse(sessionStorage.getItem(name));
}

export const removeSessionData = (name) => {
    sessionStorage.removeItem(name);
}

export const removeAllSessionData = () => {
    // Clear all session storage
    sessionStorage.clear();
}


// 6

export const updateCSSVariables = (data) => {
    const root = document.documentElement;
    root.style.setProperty('--background-color', data.background);
    root.style.setProperty('--border-color', data.border);
    root.style.setProperty('--text1-color', data.text1);
    root.style.setProperty('--text2-color', data.text2);
    root.style.setProperty('--theme-color', data.theme);
  }

