export const  separateCaratAndName = (fullName) => {
    const caratMatch = fullName.match(/^\d+KT/); // Matches the carat (e.g., "10KT")
    let carat = '';
    let name = fullName;
  
    if (caratMatch) {
      carat = caratMatch[0];
      name = fullName.replace(carat, '').trim(); // Remove the carat from the name
    }
  
    return { carat, name };
  }

