  // 14

  export const roundToTwoDecimals = (price) => {
    // Remove all non-numeric characters except for the decimal point
    const sanitizedPrice = !!price ?  price.toString().replace(/[^0-9.]/g, '') : 0;
  
    // Convert the sanitized price to a number
    const numberPrice = parseFloat(sanitizedPrice) || 0;
  
    // Format the number as currency
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
      minimumFractionDigits: 2,
      maximumFractionDigits: 2,
    }).format(numberPrice);
  };
  
  // 15

  export const increasePriceByPercentage = (price, percentage = 20) => {
    // Convert price to a number (if it's not already)
    const numberPrice = !!price ? Number(price) : 0;

    const increaseAmount = numberPrice * (percentage / 100);
    const newPrice = numberPrice + increaseAmount;
    
    return newPrice;
  }

  // 16

  export const getSubsetFromRange = (data, range) => {
    const [start, end] = range;
    // Ensure the start and end values are within the bounds of the array
    const adjustedStart = Math.max(start, 0); // Convert 1-based index to 0-based
    const adjustedEnd = Math.min(end, data.length); // Ensure the end does not exceed the array length
    
    return data.slice(adjustedStart, adjustedEnd);
  }

