const images = import.meta.glob('../assets/images/labs/*.png', { eager: true });

export const getImageFromAssets = (imageName) => {
  const imagePath = `../assets/images/labs/${imageName}.png`;

  if (images[imagePath]) {
    return images[imagePath].default; // `.default` is needed to access the image URL
  } else {
    return null;
  }
};


// 18

export const debounce = (func, wait) => {
  let timeout;
  return function (...args) {
    const context = this;
    clearTimeout(timeout);
    timeout = setTimeout(() => func.apply(context, args), wait);
  };
}


