export const getDiamondTooltipText = (key) => {
  key = sanitizeText(key)
  switch (key) {
    case 'shape':
      return `Notates the profile shape of the diamond.`
    case 'color':
      return `D, E, F are the brightest white as they are totally colorless. However, G, H, I will rarely have a noticeable color and still a great choice to consider. J, K will often have a bit of color show through, and may be more noticeable when set in white gold or platinum.`
    case 'carats':
      return `Carat is how much the diamond weight, but doesn't always guarantee exactly how large or small it will appear- this is due to the variations possible with shapes other than a round.`
    case 'clarity':
      return `FL an IF offer perfect clarity and will be priced the highest, and staying within the grades of VS2 and above will ensure an eye-clean diamond. For SI1 grades, you'll want to take a good look at the certificate and images to see what the inclusions are and how noticeable they will be.`
    case 'cut':
      return `Cut (for round brilliant shapes only) is a grade set by multiple points, and the diamond is graded for an overall quality. A high cut grade will ensure a brilliant, well balanced appearance.`
    case 'lab':
      return `For natural diamonds, we recommend GIA - its the gold standard in the industry. Other labs are known to "overgrade". For lab, we recommend IGI and GCAL.`
    case 'price':
      return `Set a budget and don't go over it - you're not going to ever sell this diamond for more than you paid. Remember to set aside money for the ring setting.`
    case 'polish':
      return `The polish grade notates how well polished the facets are, keeping this Very Good (VG) and above means the facets are optimally polished to offer the most brilliance and light return.`
    case 'symmetry':
      return `This grade is set by how well the facets are placed on the diamond, ensuring they are aligned and in the optimal angles to ensure light is able to refract internally and not be lost due to improper facet alignment.`
    case 'table':
      return `How big is the "face" of the diamond? It is a/b in this diagram. Select 'Rare Carat Ideal' on the Cut filter (or check our shape guides) to set the right values for your shape.`
    case 'depth':
      return `How much of the weight of the diamond is hiding in the bottom? It's measured as a/b in this diagram. Select Rare Carat Ideal on the Cut filter (or check our shape guides) to set the right values for your shape.`
    case 'fluorescence':
      return `Fluorescence is how much the diamond glows under black light. 'None' is most desirable, because in rare cases fluorescence can make a diamond hazy. But, in yellower colors (I and below) fluorescence can whiten your diamond.`
    case 'lwratio':
      return `Just as it sounds - the length divided by the width. A higher number means a more slender diamond, a lower one means a fatter diamond. Each shape has it's own reccommendations, ask us about this.`
    case 'fancycolor':
      return `Brown and yellow diamonds that exhibit more color than the Z grade within the D-Z color scale are known as fancy colors. Since most diamonds have a bit of yellow or brown, any other colors outside of those hues are called fancy colors. This includes pink, blue, green, black, red, and orange diamonds.`
    default:
      return `Not available!`;
  }
}

export const getSettingTooltipText = (key) => {
  key = sanitizeText(key)
  switch (key) {
    case 'shape':
      return `Notates the profile shape of the diamond.`
   case 'price':
      return `Set a budget and don't go over it - you're not going to ever sell this diamond for more than you paid. Remember to set aside money for the ring setting.`
   case 'ringstyle':
      return `Setting refers to how gemstones are set, or mounted, into a metal band. If in doubt, stick to the classic solitaire.`
  case 'metal':
      return `Brown and yellow diamonds that exhibit more color than the Z grade within the D-Z color scale are known as fancy colors. Since most diamonds have a bit of yellow or brown, any other colors outside of those hues are called fancy colors. This includes pink, blue, green, black, red, and orange diamonds.`
    default:
      return `Not available!`;
  }
}


